import React, { Component } from 'react'

class topnav extends Component {

    componentWillMount(){
        this.$el.dropdown();
    }


    render() {
        return (
            <div>
                       <div>
                          <nav>
    <div class="nav-wrapper">
      <a href="#" class="brand-logo">Krishi</a>
      <ul id="nav-mobile" class="right hide-on-med-and-down">
        <li><a href="#"></a></li>
        <li ref={el => this.el = el}><a class="dropdown-trigger" href="#!" data-target="dropdown1">Dropdown<i class="material-icons right">arrow_drop_down</i></a></li>
        
      </ul>
    </div>
  </nav> 
        </div> 
            </div>
        )
    }
}

export default topnav
